import React from 'react';
import './App.scss';

import Map from './components/map/map';
import Content from './components/content/content';

class App extends React.Component {
  render (){
    return (
      <div className="App">
        <header className="App-header">
          <Map /> 
          <Content />
        </header>      
      </div>
    );
  }
}

export default App;
